type FormValues = {
  fullName: string;
  birthDate: string;
  dateOfIssue: string;
  placeOfIssue: string;
  expireOfIssue: string;
};

const ConfirmInfoPage = (props: Props) => {
  const classes = useStyles();
  const info = parseInfoFromEKYC(MOCK_DATA);
  const resultEKYC = checkResultEkyc(MOCK_DATA);

  const {
    handleSubmit,
    formState: { errors },
    control,
  } = useForm<FormValues>({
    defaultValues: {
      fullName: info.fullNameOcr,
      birthDate: info.birthDateOcr,
      dateOfIssue: info.dateOfIssueOcr,
      placeOfIssue: info.placeOfIssueOcr,
      expireOfIssue: info.expireOfIssueOcr,
    },
  });

  const { data, onSubmit, typeCustomer, redoEKYC } = props;
  const [isAceptCondition, setIsAceptCondition] = useState(true);

  const _handleChange = (event: ChangeEvent<HTMLInputElement>) => {
    setIsAceptCondition(event.target.checked);
  };

  const _handleSubmit = (data: FormValues) => {
    onSubmit({
      ...info,
      ...data,
    });
  };

  return (
    <>
      {!resultEKYC.validEKYC && (
        <div className={classes.rootError}>
          <Box>{resultEKYC.messageEKYC}</Box>
          <Box>
            <ButtonCustom
              onClick={() => redoEKYC && redoEKYC()}
              fullWidth
              variant="contained"
              color="secondary"
            >
              Thực hiện lại
            </ButtonCustom>
          </Box>
        </div>
      )}
      {resultEKYC.validEKYC && (
        <div className={classes.root}>
          <div className={classes.tittle}>
            Xác nhận thông tin đăng ký mở TKCK
          </div>
          <form className={classes.root} onSubmit={handleSubmit(_handleSubmit)}>
            <Box mt={1} className={classes.content}>
              <Grid container direction="column" spacing={1}>
                <Grid item>
                  <Grid container spacing={1} direction="column">
                    <Grid item>Tên khách hàng:</Grid>
                    <Grid item>
                      <Controller
                        name="fullName"
                        control={control}
                        rules={{ required: true }}
                        render={({ field }) => (
                          <InputCustom
                            errorMsg={
                              errors.fullName && "This field is required"
                            }
                            fullWidth
                            {...field}
                          />
                        )}
                      />
                    </Grid>
                  </Grid>
                </Grid>
                <Grid item>
                  <Grid container spacing={1} direction="column">
                    <Grid item>
                      Giới tính: <b>{info?.gender}</b>
                    </Grid>
                    <Grid item></Grid>
                  </Grid>
                </Grid>
                <Grid item>
                  <Grid container spacing={1} direction="column">
                    <Grid item>
                      Ngày sinh: <b>{info?.birthDateOcr}</b>
                    </Grid>
                    <Grid item></Grid>
                  </Grid>
                </Grid>
                <Grid item>
                  <Grid container spacing={1} direction="column">
                    <Grid item>
                      CMND/CCCD: <b>{info?.idNumber}</b>
                    </Grid>
                    <Grid item></Grid>
                  </Grid>
                </Grid>
                <Grid item>
                  <Grid container spacing={1} direction="column">
                    <Grid item>
                      Ngày cấp: <b>{info?.dateOfIssueOcr}</b>
                    </Grid>
                    <Grid item></Grid>
                  </Grid>
                </Grid>
                <Grid item>
                  <Grid container spacing={1} direction="column">
                    <Grid item>
                      Nơi cấp: <b>{info?.placeOfIssueOcr}</b>
                    </Grid>
                    <Grid item></Grid>
                  </Grid>
                </Grid>
                <Grid item>
                  <Grid container spacing={1} direction="column">
                    <Grid item>
                      Địa chỉ tường trú: <b>{info?.address}</b>
                    </Grid>
                    <Grid item></Grid>
                  </Grid>
                </Grid>
                <Grid item>
                  <Grid container spacing={1} direction="column">
                    <Grid item>
                      Quốc tịch: <b>{info?.nationalityName}</b>
                    </Grid>
                    <Grid item></Grid>
                  </Grid>
                </Grid>
                <Grid item>
                  <Grid container spacing={1} direction="column">
                    <Grid item> Số điện thoại:</Grid>
                    <Grid item></Grid>
                  </Grid>
                </Grid>
                <Grid item>
                  <Grid container spacing={1} direction="column">
                    <Grid item>
                      Địa chỉ liên lạc: <b>{info?.address}</b>
                    </Grid>
                    <Grid item></Grid>
                  </Grid>
                </Grid>
                <Grid item>
                  <Grid container spacing={1} direction="column">
                    <Grid item>Địa chỉ email:</Grid>
                    <Grid item></Grid>
                  </Grid>
                </Grid>
                <Grid item>
                  <Grid container spacing={1} direction="column">
                    <Grid item>
                      Địa điểm mở TKCK: <b>{data.terminalName}</b>
                    </Grid>
                    <Grid item></Grid>
                  </Grid>
                </Grid>
                <Grid item>
                  <Grid container spacing={1} direction="column">
                    <Grid item>
                      Số TKTT tại HDBank: <b>{data.account}</b>
                    </Grid>
                    <Grid item></Grid>
                  </Grid>
                </Grid>
              </Grid>
            </Box>
            <Box mt={1}>
              <CheckboxCustom
                checked={isAceptCondition}
                onChange={_handleChange}
                label={
                  <div>
                    Tôi đồng ý và ủy quyền cho HDBank để cung cấp các thông tin
                    cá nhân, thông tài khoản của tôi cho Công ty chứng khoán
                    xxxxxxxxxxxx, để thực hiện các thủ tục mở tài khoản chứng
                    khoán tại Công ty chứng khoán xxxxxxxxxxx. Tôi đã đọc, hiểu
                    rõ và đồng ý với{" "}
                    <span className={classes.textTermAndCondition}>
                      Điều khoản và Điều kiện
                    </span>{" "}
                    đính kèm
                  </div>
                }
              />
            </Box>

            <Box mt={2} className={classes.content}>
              <ButtonCustom
                disabled={!isAceptCondition}
                fullWidth
                variant="contained"
                color="secondary"
                type="submit"
                // onClick={onSubmit}
              >
                Tiếp tục
              </ButtonCustom>
            </Box>
          </form>
        </div>
      )}
    </>
  );
};

export default ConfirmInfoPage;
